import React from "react";
import { Container, NavComp } from "react-bootstrap";

function Report() {
    return (
        <>
            <NavComp>
                <Container>
                    <div className="wrapper mt-4">
                        <h1>Report an Infection</h1>
                        <a style={{ fontSize: 20, color: 'white' }}>
                            Hello! This is the report page!
                        </a>
                    </div>
                </Container>
            </NavComp>
        </>
    );
}

export default Report;
